class ServersController extends AppController {

    public $components = array('RequestHandler');

    function index() {
        $this->loadModel('Bin');
        $data = $this->Bin->find('all');
        $this->set(array(
            'response' => $data,
            '_serialize' => array('response')
        ));
    }

    function categories() {
        CakeLog::debug("ENTRANDO");
        $this->loadModel('Item');
        $data = $this->Item->query('SELECT 
                                        b.*
                                        ,OnHand
                                        ,Barcode
                                    FROM Bin a, Item b
                                    where b.Code=a.Item and a.OnHand>0');
        $cartObject = array();
        foreach($data as $c){
           $cartObject[]['Item'] = $c[0]; 
        }
        $this->set('response', $cartObject);
    }

    function image($item) {
        $this->layout = null;
        $this->loadModel('ItemImage');
        $data = $this->ItemImage->find('first', array(
            'conditions' =>
            array('Code' => $item)
        ));
        if ($data) {
            $bytes = hex2bin($data['ItemImage']['Picture']);
            $data = base64_encode($bytes);
        } else {
            $data = '';
        }
        $this->set('data', $data);
    }

    function imageitem($item) {
        $this->layout = null;
        $this->loadModel('ItemImage');
        $data = $this->ItemImage->find('first', array(
            'conditions' =>
            array('Code' => $item)
        ));
        if ($data) {
            $bytes = hex2bin($data['ItemImage']['Picture']);
            $data = base64_encode($bytes);
        } else {
            $data = '';
        }
        $this->set('data', $data);
    }

    function imagebyte($item) {
        $this->layout = null;
        $this->loadModel('ItemImage');
        $data = $this->ItemImage->find('first', array(
            'conditions' =>
            array('Code' => $item)
        ));
        if ($data) {
            $bytes = base64_encode(hex2bin($data['ItemImage']['Picture']));
        } else {
            $bytes = '';
        }
        $this->set('iac', $item);
        $this->set('data', $bytes);
    }

    function searchByCriteria($criteria) {
        $this->layout = null;
        $this->loadModel('Item');
        $data = $this->Item->query("SELECT 
                                        b.*
                                        ,OnHand
                                        ,Barcode
                                    FROM Bin a, Item b
                                    where b.Code=a.Item and a.OnHand>0 and (Code Like '%".$criteria."%' or Description1 like '%".$criteria."%')");
        $cartObject = array();
        foreach($data as $c){
           $cartObject[]['Item'] = $c[0]; 
        }
        $this->set('response', $cartObject);
    }

    protected function hextostr($x) {
        $s = '';
        foreach (explode("\n", trim(chunk_split($x, 2))) as $h)
            $s.=chr(hexdec($h));
        
        return($s);
    }

    public function job($sku,$vendedor, $boleta, $imei) {
        $this->loadModel('Item');
        $this->loadModel('Job');
        $this->loadModel('JobItem');
        $r = $this->Item->find('first',array('conditions'=>array('Code'=>$sku)));
        $jobId = mt_rand(1000, 999999);
        $data = array();
        $data['Job']['MyNo']=$jobId;
        $data['Job']['Description']=$boleta;
        $data['Job']['Active']=1;
        $data['Job']['Notes']=$vendedor;
        $this->Job->save($data);
        $data=array();
        $data['JobItem']['MyNo'] = $jobId;
        $data['JobItem']['ItemCode'] = $sku;
        $data['JobItem']['QtyReq'] = 1;
        $data['JobItem']['Description'] = $r['Item']['Description1'];
        $this->JobItem->save($data);
        $response = new Object();
        $response->state = 'OK';
        $response->message = 'PROCESO EXITOSO';
        $response->codigo = $jobId;
        $this->set('response', $response);
        
        
    }


}

?>
